import Link from 'next/link';
import classNames from 'classnames';
import { Container } from '../styles/NavBar';

const NavBar = ({ classes, children, ...restProps }) => {
    return(
        <Container className={classNames('navbar', classes)} {...restProps}>
            <nav>
                <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
                    <li className="nav-item">
                        <Link href="/">
                            <a id="logo">
                                <img className="w-32" src="/images/SpaceX-Logo.svg" />
                            </a>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link href="/about">
                            <a className="py-2 flex items-center text-xs uppercase font-bold font-poppins text-white hover:opacity-75">About</a>
                        </Link>
                    </li>
                </ul>
            </nav>
        </Container>
    )
}

export default NavBar;
